  [],\n\t\"revision_timestamp\": \"2015-11-25T17:35:02.436059\",\n\t\"name\": \"gldas-vic-land-surface-model-l4-3-hourly-1-0-x-1-0-degree-v001\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This data set contains a series of land
  surface parameters simulated from the Variable Infiltration Capacity (VIC) Model
  in the Global Land Data Assimilation System (GLDAS). The data are in 1.0 degree
  resolution and range from 1979 to the present. The temporal resolution is 3-hour.n
  \                                         n                                    This
  simulation was forced by combination of NOAA/GDAS atmospheric analysis fields, spatially
  and temporally disaggregated NOAA Climate Prediction Center Merged Analysis of Precipitation
  (CMAP) fields, and observation based downward shortwave and longwave radiation fields
  derived using the method of the Air Force Weather Agency's AGRicultural METeorological
  modeling system (AGRMET). n                                    The simulation was
  initialized on 1 January 1979 using soil moisture and other state fields from a
  GLDAS/VIC model climatology for that day of the year.n                                          n
  \                                   WGRIB or other GRIB reader is required to read
  the files. The data set applies a user-defined parameter table to indicate the contents
  and parameter number. The GRIBTAB file (http://disc.sci.gsfc.nasa.gov/hydrology/grib_tabs/gribtab_GLDAS_VIC.txt)
  shows a list of parameters for this data set, along with their Product Definition
  Section (PDS) IDs and units.nnFor more information, please see the README Document
  at ftp://hydro1.sci.gsfc.nasa.gov/data/s4pa/GLDAS_V1/README.GLDAS.pdf.\",\n\t\"license_title\":
